select(2, ...).LoadData("APP_INFO","Global",[[return {version=405,lastSync=1604382823,message={id=0,msg=""},news={{title="TradeSkillMaster v4.10.14 Changelog",content="TSM v4.10.14 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed tooltip error when hovering over favorite searches<br />* Fixed error on base group UI after removing a group<br />* Fixed TSM taking a long time on logout for some users<br />* [Retail] Added additional bonusIds<br />* [Retail] Added light/rich illusion dust conversion<br />* [Retail] Updated ink trading for Shadowlands<br />* [Retail] Fixed error when syncing professions between accounts<br />* [Retail] Fixed error when creating profession groups<br />* [Retail] Fixed issue with &#8220;/disenchant&#8221; search filter<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1604257412,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-14-changelog/"},{title="TradeSkillMaster v4.10.13 Changelog",content="TSM v4.10.13 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with some items causing My Auctions to not load properly<strong>Known Issues</strong><br